import React from "react";
import style from "./Form.module.css"

export default function Form (){
    return(
    <div>
        <form>
            <label>Email</label>
            <input 
            name="email"
            type="text"
            className={style.email}
            />
            <label>Password</label>
            <input 
            name="password"
            type="text"
            className={style.password}
            />
            <button type="submit"
            className={style.boton}
            >Submit</button>
        </form>
    </div>
    )
}
